import React, {useRef} from "react";


const ImageChangeOnMouseOver = () => {
    return (
        <div>
            <ImageToggleOnMouseOver  src="/static/1.jpg" alt=""/>
            <p></p>
            <ImageToggleOnMouseOver src="/static/2.jpg" alt=""/>

        </div>

    );
}

export default ImageChangeOnMouseOver;
